def parse_menu(text):
    lines = text.strip().split('\n')
    menu = []
    category = None
    subcategory = None
    item_id = 1

    for line in lines:
        line = line.strip()
        if not line:
            continue

        # Category
        if line.startswith('🍽') or line.startswith('🍣') or line.startswith('🍛') or line.startswith('🍚') or line.startswith('🍨') or line.startswith('☕') or line.startswith('🧊') or line.startswith('🥡') or line.startswith('🍸') or line.startswith('🥂') or line.startswith('🍷') or line.startswith('🌸') or line.startswith('🍇') or line.startswith('🍺') or line.startswith('🍶') or line.startswith('🥃') or line.startswith('🟡'):
            category = line.split(' ', 1)[1].strip()
            subcategory = None
            continue

        # Subcategory
        if line.isupper() and not '$' in line:
            subcategory = line.strip()
            continue
            
        # Item
        match = re.match(r'(.+?)\s·\s\$(\d+\.?\d*)\s?(.*)', line)
        if not match:
            match = re.match(r'(.+?)\s-\s\$(\d+\.?\d*)\s?(.*)', line)
        if not match:
            match = re.match(r'(.+?)\s–\s\$(\d+\.?\d*)\s?(.*)', line)
        if not match:
            match = re.match(r'(.+?)\s·\s(\d+)\s?(.*)', line)

        if match:
            name = match.group(1).strip()
            price = float(match.group(2))
            description = match.group(3).strip()
            
            menu.append({
                "id": item_id,
                "name": name,
                "price": price,
                "description": description,
                "category": category,
                "subCategory": subcategory,
                "image": f"https://source.unsplash.com/400x300/?{name.replace(' ', '+')}"
            })
            item_id += 1

    return menu

if __name__ == '__main__':
    menu_data = parse_menu(menu_text)
    with open('menu.json', 'w') as f:
        json.dump(menu_data, f, indent=4)
